import React, { Component, useState, useRef, useEffect } from 'react';
import { useParams, useNavigate } from "react-router-dom";
import axios from 'axios';
import defaultposter from './search/defaultposter.jpeg';

import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TextField from '@mui/material/TextField';
import { Table, TableBody, TableCell, TableRow } from "@mui/material";
import Tooltip from '@mui/material/Tooltip';
import { createTheme, ThemeProvider } from '@mui/material/styles';


// RATAOUILLE ID 2062
// EVERYTHING EVERYWHERE ID 545611

export default function Info() {
    const params = useParams();
    const navigate = useNavigate();

    const [title, setTitle] = useState("");
    const [year, setYear] = useState("");
    const [tagline, setTagline] = useState("");
    const [overview, setOverview] = useState("");
    const [poster, setPoster] = useState("");

    const [director, setDirector] = useState([]);
    const [cast, setCast] = useState([{
        cast_id: "",
        actor: "",
        character: "",
    }]);

    useEffect(() => {
        async function fetchData() {
        //   const id = params.id.toString();
        const info = await axios(
            `https://api.themoviedb.org/3/movie/545611?api_key=dbc0a6d62448554c27b6167ef7dabb1b&language=en-US`
        );
        // console.log(info.data);
        setTitle(info.data.title);
        setYear(info.data.release_date.substring(0, 4));
        setTagline(info.data.tagline.toUpperCase());
        setOverview(info.data.overview);
        const posterPath = info.data.poster_path != null ? `http://image.tmdb.org/t/p/original${info.data.poster_path}` : defaultposter
        setPoster(posterPath);
        }

        async function fetchCredits() {
            //   const id = params.id.toString();
            const credits = await axios(
                `https://api.themoviedb.org/3/movie/545611/credits?api_key=dbc0a6d62448554c27b6167ef7dabb1b&language=en-US`
            );

            const castArr = [];
            for (let i = 0; i < credits.data.cast.length; i++) {
                castArr.push({cast_id: credits.data.cast[i].cast_id, actor: credits.data.cast[i].name, character: credits.data.cast[i].character})
            }
            setCast(castArr);

            const dirArrFilter = credits.data.crew.filter(person => person.job === "Director");
            const dirArr = [];
            for (let j = 0; j < dirArrFilter.length; j++) {
                dirArr.push(dirArrFilter[j].original_name);
            }
            setDirector(dirArr);
        }

        fetchData();
        fetchCredits();
        return;
    }, []);

    const generateCast = () => {
        return (
          <Table>
            <TableBody>
              {cast.map((cast) => (
                <TableRow
                  key={cast.cast_id}
                //   sx={{ 
                //     '&:last-child td, &:last-child th': { border: 0 } ,
                //     '&:first-child td, &:first-child th': { borderTop: 1, color: "#dee2e6" }
                //   }}
                >
                  <TableCell component="th" scope="row" id="poster" className="col-sm-1">
                  <Tooltip title={cast.character} placement="top">
                    <Button>{cast.actor}</Button>
                  </Tooltip>
                  </TableCell>
                  <TableCell component="th" scope="row" id="name" className="col-sm-1">
                    {cast.character}
                  </TableCell>
                </TableRow>       
              ))}
            </TableBody>
          </Table>
        );
      }

    return (
      <div style={{marginTop: 100, marginLeft: 250, marginRight: 250}}>
        <div className="container">
            <h3 style={{display: "inline", marginRight: 10}}>{title}</h3>
            <p class="text-muted" style={{fontSize: 22, display: "inline"}}>({year})</p>
            <p>Directed by: {director[0]} & {director[1]}</p>
            <div class="row">
                <div class="col-4 nopadding">
                    <img src={poster} style={{width: 300}} class="img-fluid"/>
                </div>
                <div class="col">
                    <h6>{tagline}</h6>
                    <p>{overview}</p>
                    <br></br>
                    <h6>CAST</h6>
                    {generateCast()}
                </div>
            </div>
        </div>
      </div>
    );
  }
